import React from "react";
import food from "./sprites/apple.png";
import body from "./sprites/body.png";
import head from "./sprites/head.png";
import tail from "./sprites/tail.png";

const Food = props => {
  // const style = {
  //   left: `${props.dot[0]}`,
  //   top: `${props.dot[1]}`
  // };

  return (
    <div id="snakeFood">
      <img src={food} alt="" />
      <img src={tail} alt="" />
      <img src={body} alt="" />
      <img src={tail} alt="" />
    </div>
  );
};

export default Food;
